import{_ as p,c as a,o as e,ag as s}from"./chunks/framework.BVgKs9HZ.js";const d=JSON.parse('{"title":"2016年1月16日出游日志","description":"还有十个工作日就可以回家过春节了，加上丽姐要从宏福苑搬到所里宿舍，我们宏福苑的六只就趁着周末出去拍照，顺便吃个饭，看个电影，赏个雪。","frontmatter":{"title":"2016年1月16日出游日志","date":"2016-05-02T13:40:50.000Z","tags":["一日一记"],"description":"还有十个工作日就可以回家过春节了，加上丽姐要从宏福苑搬到所里宿舍，我们宏福苑的六只就趁着周末出去拍照，顺便吃个饭，看个电影，赏个雪。"},"headers":[],"relativePath":"post/diary/2016-2017/2016-1-16.md","filePath":"post/diary/2016-2017/2016-1-16.md"}'),r={name:"post/diary/2016-2017/2016-1-16.md"};function n(o,t,i,c,_,l){return e(),a("div",null,t[0]||(t[0]=[s('<blockquote><p>概要：由于惦记着要抢猴年纪念币，一晚上没睡好，四点多醒了一次，抢到后就睡不着了，想着还得抢一份，不然回家不好分，然后就在等瞻哥自然醒，想用他的身份证号，又思量猴币有3亿枚呢，不用着急，还是先睡等上午再说，就这样在想前想后中睡睡醒醒，等到8点多一查，果然已经没了，只好又用二姐的身份证号在济南建行预约了一份。</p></blockquote><p><strong>白天</strong>起来没多少精神，上午去集市溜达了一圈，没什么可买的，吃了份泡馍就又回宿舍了。晚上丽姐在五道口请吃饭，我想中午眯一会，下午三点多和全能瞻坐地铁过去。全能瞻说：还睡啥，看一会电子书就到时间了，然，等到3点半闹钟响时，某瞻的呼噜声也是哼隆隆隆的。</p><p>丽姐和冬姐先到五道口去逛街了，我们问她们在哪里，她们总是回一句：在买枣糕呢。等我们到卖枣糕的地方，发现人好多，根本找不到她们。只好按照给的地图去漫无目的的找，走了n条路，问了n个人，没人知道那个饭店在哪里。路上偶遇几个同样在找那家店的人，他们找到了，然后又指给我们，<strong>遇叶日本料理</strong>再也不去了，太难找了。</p><p>我所去过的日本料理店大多都是窄窄的，可能这也是日本特色，毕竟日本这么小，得充分节省空间，不像中华大饭店是人挤人，这里是人挤桌。不过还好，我们坐最里面，不用进进出出。就是桌子非常小，能放四个菜就不错了，上了就得吃，吃了就得撤。然而，妹子们都忙着拍照。左拍拍，右拍拍，前拍拍，后拍拍，各种拍。全能瞻也变成了背景瞻。先上了寿司，生鱼片，炸鸡块，沙拉等不熟悉食物，后来上大炖锅小炖锅烤肠米饭等，像是吃了两顿饭。吃完饭时6：30,我们从五道口准备撤，新惠去找她同学嗨，我们则准备坐地铁回了。</p><p>然，看看远方，发现灯光灿烂，于是乎，我们临时决定去看看电影，去回龙观看，毕竟距离宿舍还近点。看什么呢，找了几个全能瞻和冬姐都看过，最后依照时间和内容，我们选择最后的巫师猎人。就这样，在忙乱中我们的地铁坐反了，只好从13号线又坐回来，到星美国际影城去。虽然有些累有些困，但气氛还是不错的，抱着奶茶和爆米花，我们五只晃晃悠悠的进影院时，大部分座位还是空的，尽管不知道为什么订票的时候订不到，或许是糯米订票的限制吧。</p><p>《最后的巫师猎人》由范迪赛尔主演的，出场时吓我一跳，这个胡子可真难看。然后大女巫出来就有点恐怖的感觉。外国的科幻片向来细节做的很好，像剑与火，发现巫师，圈养蝴蝶的昆虫巫师，dreamwalker，巫师猎人的气场等等，期间数次的梦境都让我错以为是盗梦空间了。然而和中国玄幻大片比起来，就是剧情不够丰满，和捉妖记/寻龙诀等相比起来，剧情略显单薄。不过对得起2D电影票价了。电影最后是圆满结束的，肥范和女主快快乐乐的穿越到《速度与激情》中飙车去了。</p><p>从影院出来发现，下雪了，真是吓一跳。这天气，真好。</p><p>话不多说，上图: <img src="http://ww3.sinaimg.cn/mw690/006lPiqbjw1f04x2trh0aj30hs0nqdi4.jpg" alt="饭图"><img src="http://ww2.sinaimg.cn/mw690/006lPiqbjw1f04x35ny0fj30f30qo76j.jpg" alt="票图"><img src="http://ww4.sinaimg.cn/mw690/006lPiqbjw1f04x3ej5qwj30hs0nqtbg.jpg" alt="雪图"></p>',8)]))}const g=p(r,[["render",n]]);export{d as __pageData,g as default};
